      <h1>Chathila Ratnatilake</h1>
      <p>Software Engineering Student at the University of Alberta</p>
      <div className='hero-btns'>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          Learn more
        </Button>
        <Button
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
          Learn more
        </Button>

      </div>
    </div>
  );
}

export default HeroSection;

